import './App.css';
import homeImage from '../src/static/loginHome.jpeg'
function App() {
  return (
    <div className="container">
      <img src={homeImage} alt="login" />
      <form className="input-form">
        <p className="login-header"> Login into the world of table tennis</p>
        <label>Email Id: &nbsp; &nbsp; <input type="text" /></label><br /><br />
        <label>Password: <input type="text" /></label><br /><br />
        <button type="submit" className="login-submit-button">Login</button>

      </form>
    </div>
  );
}

export default App;
